import React, { Component } from 'react'

class SideBar extends Component {
    render() { 
        return(
            <div style={styles.sideBarStyle}>
                <h1>Sidebar</h1>
            </div>
        )
    }
}

const styles = {
    sideBarStyle: {
        backgroundColor: 'white',
        width: '100%',
        borderRadius: 8,
        boxShadow: '5px 55px 50px -20px #b6b6b6'
    }
}

export default SideBar
